import cover_image from '../assets/cover_image.jpg'

const Login = () => {
    return (
        <div className="w-full h-screen flex items-start">
            {/* Container dengan gambar sebagai background */}
            <div
                className="relative w-full h-full flex flex-col"
                style={{
                    backgroundImage: `url(${cover_image})`,
                    backgroundSize: 'cover',
                    backgroundPosition: 'center',
                    backgroundRepeat: 'no-repeat',
                }}
            >
                {/* Teks di atas background gambar dengan jarak dari kiri */}
                <div className="absolute z-10 top-1/3 left-8"> {/* Posisi teks di kiri atas dengan jarak */}
                    <h1 style={{ color: 'white', fontSize: '2.5rem', fontWeight: 'bold' }}>Turn Your Ideas into Reality</h1>
                    <p style={{ color: 'white', fontSize: '1.25rem', marginTop: '0.25rem' }}>Start for free and get attractive offers from the community</p>
                </div>
            </div>
        </div>
    )
}

export default Login;
